.form {
  margin-top: 1rem;
  display: flex;
  align-items: center;
  justify-content: flex-end;

  &-control {
    margin-top: 1rem;

    &__question {
      font-size: 1.2rem;
    }
    &__warning {
      color: #f72119;
      margin-top: 1rem;
      padding-bottom: 1.5rem;
    }

    &__submission {
      margin-top: 3rem;
    }

    &.dropzone {
      padding: 2rem;
      cursor: pointer;
    }

    &__dropzone {
      padding: 2rem;
      border: 1px dashed $trans-light-s;
      display: block;
      margin: -2rem;
      border-radius: 1rem;

      @include transition(background border);

      user-select: none;

      &.grabbing {
        border: 1px dashed $opaque-light;
        background: $trans-light-s;
      }

      &__input {
        display: none;
      }

      &__preview {
        display: flex;
        align-items: center;
        justify-content: center;

        img {
          width: auto;
          max-width: 100%;
          margin-top: 2rem;
          border-radius: 1rem;
        }
      }
    }

    &__inner {
      position: relative;
    }

    &__slider {
      display: flex;
      flex-flow: column;
      padding: 1rem 2rem;

      label {
        display: flex;
        justify-content: space-between;

        div {
          color: $trans-light-md;
          font-size: 0.8rem;

          span {
            color: $text-light;
            font-size: 1rem;
            font-weight: 500;
          }
        }
      }

      input {
        -webkit-appearance: none;
        appearance: none;
        width: 100%;
        height: 25px;
        background: $opaque-light;
        outline: none;
        opacity: 0.7;
        transition: opacity 200ms;
        height: 1px;
        margin: 1rem 0;
        border: 1px solid $opaque-light;
        border-radius: 20rem;

        &:hover {
          opacity: 1;
        }

        &::-webkit-slider-thumb {
          -webkit-appearance: none;
          appearance: none;
          width: 1rem;
          height: 1rem;
          background: $text-light;
          cursor: grab;
          border-radius: 1rem;
        }
      }
    }

    &__label {
      position: absolute;
      top: 50%;
      left: 2rem;
      opacity: 1;
      transform: translate(0, -50%);
      z-index: 3;
      @include transition(top left transform);
      transform-origin: center left;

      &.hide {
        top: 0;
        left: 2rem;
        transform: translate(0, -50%) scale(0.8);
      }
    }

    &__placeholder {
      position: absolute;
      top: 50%;
      left: 2rem;
      opacity: 1;
      transform: translate(0, -50%);
      z-index: 2;
      opacity: 0.2;
      @include transition(opacity);

      &.hide {
        opacity: 0;
      }
    }

    &__input {
      padding: 1rem 2rem;
      background: $trans-light-xs;
      border-radius: 4px;
      border: 1px solid $trans-light-s;
      color: $text-light;
      font-family: $text-font-stack;
      width: 100%;
      outline: none;

      @include transition(border-color backdrop-filter background);

      &::placeholder {
        color: $text-light;
        background: $main-dark;
      }

      &:focus {
        background: $trans-light-s;
        backdrop-filter: $blur-sm;
      }
    }
  }
}

